  false,\n\t\"url\": null,\n\t\"notes\": \"These data were collected under a cooperative
  agreement with the Massachusetts Office of Coastal Zone Management (CZM) and the
  U.S. Geological Survey (USGS), Coastal and Marine Geology Program, Woods Hole Coastal
  and Marine Science Center (WHSC). Initiated in 2003, the primary objective of this
  program is to develop regional geologic framework information for the management
  of coastal and marine resources. Accurate data and maps of sea-floor geology are
  important first steps toward protecting fish habitat, delineating marine resources,
  and assessing environmental changes due to natural or human impacts. The project
  is focused on the inshore waters of coastal Massachusetts, primarily in water depths
  of 3-30 meters deep. Data collected for the mapping cooperative have been released
  in a series of USGS Open-File Reports (http://woodshole.er.usgs.gov/project-pages/coastal_mass/).
  The data collected in the study area located in Vineyard Sound Massachusetts includes
  high-resolution geophysics (bathymetry, backscatter intensity, and seismic reflection).
  The data were collected during three separate surveys conducted between 2009 and
  2011and cover approximately 340 square kilometers of the inner continental shelf.
  More information about the individual USGS surveys conducted as part of the Vineyard
  Sound project can be found on the Woods Hole Coastal and Marine Science Center Field
  Activity webpage: 2009-002-FA: http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2009-002-FA
  2010-004-FA: http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2010-004-FA
  2011-004-FA: http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2011-004-FA\",\n\t\"license_title\":
